import Button from 'react-bootstrap/Button';
import { useNavigate } from 'react-router-dom';

export const Setup = () => {
    return (
        <>
            <h2>Setup</h2>
            <Button 
                variant="primary"
                onClick={() => nav("/setup")}    
            >
                Select Players
            </Button>{' '}
        </>
    );
};
